	public boolean isAgentInAnyList(WebDriver driver, String agentName) {
		List<String> offlineAgents = getOfflineAgentsList(driver);
		if(offlineAgents != null && offlineAgents.contains(agentName)) {
			return true;
		}
		
		List<String> BusyAgents = getTextListFromElements(driver, busyAgentsAvatarList);
		if(BusyAgents != null && BusyAgents.contains(agentName)) {
			return true;
		}
		
		List<String> AvailableAgents = getTextListFromElements(driver, availableAgentsList);
		if(AvailableAgents != null && AvailableAgents.contains(agentName)) {
			return true;
		}
		
		return false;
	}
	
